#define RGB_LCD_DelayMs(Ms)				SMDrv_SYS_DelayMs(Ms)
#define RGB_LCD_DelayUs(Us)				SMDrv_SYS_DelayUs(Us)
#define RGB_LCD_CLKDelay()				//__nop()	//am_hal_flash_delay(1)	//RGB_LCD_DelayUs(1)		// 模拟时序延时
#define RGB_LCD_PowerOnDelay()			RGB_LCD_DelayMs(1)		// 上电延时
#define RGB_LCD_PowerOffDelay()			RGB_LCD_DelayMs(1)		// 掉电延时


// 内部函数声明 ********************************************************************
static void Drv_RGBLcd_IOinit(void);
static void Drv_RGBLcd_IOSleep(void);
static void Drv_RGBLcd_IOWakeup(void);
static void Drv_RGBLcd_WriteStart(void);
static void Drv_RGBLcd_WriteData(uint16_t ValBit, uint8_t ClkNum, uint8_t MSB);
static uint32_t Drv_RGBLcd_Single1Bit(uint16_t Addr, uint8_t BufLen,uint8_t* DotBuf);
static uint32_t Drv_RGBLcd_Single3Bit(uint16_t Addr, uint8_t BufLen,uint8_t* DotBuf);
static uint32_t Drv_RGBLcd_Multiple3Bit(uint16_t StartLine, uint8_t LineNum,uint8_t* DotBuf);

//**********************************************************************
// 函数功能：RGBLcd 屏 IO 口初始
// 输入参数：   
// 返回参数：	
static void Drv_RGBLcd_IOinit(void)
{
    SMDrv_GPIO_Open(RGB_LCD_EN_PIN,			NULL, NULL);
	SMDrv_GPIO_Open(RGB_LCD_SCLK_PIN,		NULL, NULL);
    SMDrv_GPIO_Open(RGB_LCD_SI_PIN,			NULL, NULL);
	SMDrv_GPIO_Open(RGB_LCD_SCS_PIN,		NULL, NULL);
    SMDrv_GPIO_Open(RGB_LCD_EXTCOMIN_PIN,	NULL, NULL);
	SMDrv_GPIO_Open(RGB_LCD_DISP_PIN,		NULL, NULL);
	SMDrv_GPIO_Open(RGB_LCD_BCKLED_PIN,	    NULL, NULL);	// 暂时初始化背光口，因为跟烧录口公用，会导致无法烧录和调试
	
	Drv_RGBLcd_IOSleep();
}

//**********************************************************************
// 函数功能：RGBLcd 屏 IO 口配置为休眠状态（防止漏电流）
// 输入参数：   
// 返回参数：
static void Drv_RGBLcd_IOSleep(void)
{
	RGB_LCD_EN_PIN_SET();
	RGB_LCD_SCLK_PIN_CLEAR();
	RGB_LCD_SI_PIN_CLEAR();
	RGB_LCD_SCS_PIN_CLEAR();
	RGB_LCD_EXTCOMIN_PIN_CLEAR();
	RGB_LCD_DISP_PIN_CLEAR();
//	RGB_LCD_BCKLED_PIN_SET();	
}

//**********************************************************************
// 函数功能：RGBLcd 屏 IO 口配置为工作状态
// 输入参数：   
// 返回参数：
static void Drv_RGBLcd_IOWakeup(void)
{
	// 上电
	RGB_LCD_EN_PIN_CLEAR();		
	RGB_LCD_PowerOnDelay();

	// 屏幕显示使能
	RGB_LCD_DISP_PIN_SET();
	RGB_LCD_DelayUs(1);			// 大于50ns即可
	
}

//**********************************************************************
// 函数功能：    配置好信号线，开始写入数据
// 输入参数：    无
// 返回参数：    无
static void Drv_RGBLcd_WriteStart(void)
{
	// 片选使能
	RGB_LCD_SCS_PIN_SET();
	
	// 时钟先拉低
	RGB_LCD_SCLK_PIN_CLEAR();
	
	RGB_LCD_CLKDelay();	
}

//**********************************************************************
// 函数功能：    向RGBLcd写入时钟数据
// 输入参数：    ValBit 按位写入的数据，最大16bit
//				 ClkNum 时钟数
// 				 MSB 1高位在前，0低位在前
// 返回参数：    无
static void Drv_RGBLcd_WriteData(uint16_t ValBit, uint8_t ClkNum, uint8_t MSB)
{
	for(uint32_t i = 0;i < ClkNum;i++)
	{
		if(MSB)
		{
			if(ValBit & 0x8000)
				RGB_LCD_SI_PIN_SET();
			else
				RGB_LCD_SI_PIN_CLEAR();
			RGB_LCD_CLKDelay();

			RGB_LCD_SCLK_PIN_SET();
			RGB_LCD_CLKDelay();
			RGB_LCD_SCLK_PIN_CLEAR();
			
			ValBit <<= 0x01;		
		}
		else
		{
			if(ValBit & 0x0001)
				RGB_LCD_SI_PIN_SET();
			else
				RGB_LCD_SI_PIN_CLEAR();
			RGB_LCD_CLKDelay();

			RGB_LCD_SCLK_PIN_SET();
			RGB_LCD_CLKDelay();
			RGB_LCD_SCLK_PIN_CLEAR();
			
			ValBit >>= 0x01;
		}
	}	
}

//**********************************************************************
// 函数功能：    1 Bit 模式更新 RGBLcd 单行显示
// 输入参数：    Addr 行地址，1~176
// 				 BufLen 点阵数组长度
// 				 DotBuf 点阵数组内容
// 返回参数：    无
static uint32_t Drv_RGBLcd_Single1Bit(uint16_t Addr, uint8_t BufLen,uint8_t* DotBuf)
{
	#if 0	// 不再维护，使用时请再参考数据手册
	uint16_t TmpModeBit = 0x8800;
	
	TmpModeBit |= Addr;
	
	Drv_RGBLcd_WriteStart();
	
	// 写入模式和地址
	Drv_RGBLcd_WriteData(TmpModeBit, 16);
	
	// 写入数据
	for(uint32_t i = 0;i < BufLen;i++)
	{
		Drv_RGBLcd_WriteData((uint16_t)(DotBuf[i]<<8), 8);
	}
	
	// 写入结束
	Drv_RGBLcd_WriteData(0x0000, 16);
	#endif
	
	return 0;
}

//**********************************************************************
// 函数功能：    3 Bit 模式更新 RGBLcd 单行显示(时序请参考数据手册)
// 输入参数：    Addr 行地址，1~176
// 				 BufLen 点阵数组长度
// 				 DotBuf 点阵数组内容
// 返回参数：    无
static uint32_t Drv_RGBLcd_Single3Bit(uint16_t Addr, uint8_t BufLen,uint8_t* DotBuf)
{
	uint16_t TmpModeBit = 0x8000;
	
	if((0 == Addr) || (Addr > RGB_LCD_PIXEL_WIDTH)) 
		return 0xFF;
	
	Drv_RGBLcd_WriteStart();
	
	// 写入模式和地址
	TmpModeBit |= Addr;
	Drv_RGBLcd_WriteData(TmpModeBit, 16, 1);
	
	// 写入数据
	for(uint32_t i = 0;i < BufLen;i++)
	{
		// bit0~2为低像素点
		Drv_RGBLcd_WriteData((uint16_t)(DotBuf[i]), 3, 0);
		// bit4~6为高像素点
		Drv_RGBLcd_WriteData((uint16_t)(DotBuf[i]>>4), 3, 0);		
	}
	
	// 写入结束，16个空时钟
	Drv_RGBLcd_WriteData(0x0000, 16, 0);	
}

//**********************************************************************
// 函数功能：    3 Bit 模式更新 RGBLcd 多行显示
// 输入参数：    StartLine 行地址，1~176
// 				 LineNum 刷新行数
// 				 DotBuf 二维点阵数组内容
// 返回参数：    无
static uint32_t Drv_RGBLcd_Multiple3Bit(uint16_t StartLine, uint8_t LineNum,uint8_t* DotBuf)
{
	uint16_t TmpModeBit = 0x8000;
	
	if((0 == StartLine) || (StartLine > RGB_LCD_PIXEL_WIDTH)) 
		return 0xFF;
	
	if((StartLine + LineNum - 1) > RGB_LCD_PIXEL_WIDTH)
		return 0xFF;
	
	// 信号线初始化
	Drv_RGBLcd_WriteStart();
	
	// 写入模式
	Drv_RGBLcd_WriteData(TmpModeBit, 6, 1);
	
	// 写入数据
	for(uint32_t i = 0;i < LineNum;i++)
	{
		// 行地址
		Drv_RGBLcd_WriteData((StartLine+i)<<6, 10, 1);
		
		// 写数据
		for(uint32_t j = 0;j < 88;j++)
		{
			// bit0~2为低像素点
			Drv_RGBLcd_WriteData((uint16_t)(DotBuf[(StartLine+i-1)*88 + j]) << 9, 3, 1);
			// bit4~6为高像素点
			Drv_RGBLcd_WriteData((uint16_t)(DotBuf[(StartLine+i-1)*88 + j]) << 13, 3, 1);		
			
//			// bit0~2为低像素点
//			Drv_RGBLcd_WriteData((uint16_t)(DotBuf[StartLine+i-1][j]), 3, 0);
//			// bit4~6为高像素点
//			Drv_RGBLcd_WriteData((uint16_t)(DotBuf[StartLine+i-1][j]>>4), 3, 0);
		}
		
		// 每写完一行，发送6个空时钟
		Drv_RGBLcd_WriteData(0x0000, 6, 0);
	}
	
	// 写入结束，6+10个空时钟
	Drv_RGBLcd_WriteData(0x0000, 10, 0);
}

