// EXTCOMIN 给脉冲
void Drv_RGBLcd_Inversion(void)
{
	RGB_LCD_EXTCOMIN_PIN_SET();
	RGB_LCD_DelayMs(1);	
	RGB_LCD_EXTCOMIN_PIN_CLEAR();
}

uint32_t Drv_RGBLcd_Init(void)
{
	Drv_RGBLcd_IOinit();
}

void Drv_RGBLcd_RefreshAll(uint8_t* DotBuf)
{
	Drv_RGBLcd_Wakeup();
	
	Drv_RGBLcd_Multiple3Bit(1, 176, DotBuf);
}

